import React from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
    width: '100%',
    height: '100%'
};

const GoogleMaps = (props) => {

    return (
        <Map
            google={props.google}
            zoom={5}
            style={mapStyles}
            initialCenter={{
                lat: 44.9928562,
                lng: 17.24647522
            }}
        />
    );
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyCvFrGxeLjEHl7V3Vyox1M6Aq4vxL-xkTU'
})(GoogleMaps);
